import React from 'react';
import './block.css';
import { block01, block02, block03, block04, block05 } from './imports';
import Article from '../../components/article/Article';

const Block = () => {
  return (
      <div className="gpt3__block section__padding" id="block">
          <div className="gpt3__block-heading">
              <h1 className="gradient__text">A lot is happening, <br /> We are blogging about it.</h1>
          </div>
          <div className="gpt3__block-container">
              <div className="gpt3__block-container_groupA">
                  <Article imgUrl={block01} date="Sep 26, 2021" text="GPT-3 and Open  AI is the future. Let us exlore how it is?" />
              </div>
              <div className="gpt3__block-container_groupB">
                  <Article imgUrl={block02} date="Sep 26, 2021" text="GPT-3 and Open  AI is the future. Let us exlore how it is?" />
                  <Article imgUrl={block03} date="Sep 26, 2021" text="GPT-3 and Open  AI is the future. Let us exlore how it is?" />
                  <Article imgUrl={block04} date="Sep 26, 2021" text="GPT-3 and Open  AI is the future. Let us exlore how it is?" />
                  <Article imgUrl={block05} date="Sep 26, 2021" text="GPT-3 and Open  AI is the future. Let us exlore how it is?" />
              </div>
          </div>
      </div>
  )
}

export default Block
